(156, '_transient_acf_plugin_info_pro', 'a:17:{s:4:\"name\";s:26:\"Advanced Custom Fields PRO\";s:4:\"slug\";s:26:\"advanced-custom-fields-pro\";s:8:\"homepage\";s:37:\"https://www.advancedcustomfields.com/\";s:7:\"version\";s:5:\"5.6.7\";s:6:\"author\";s:13:\"Elliot Condon\";s:10:\"author_url\";s:28:\"http://www.elliotcondon.com/\";s:12:\"contributors\";s:12:\"elliotcondon\";s:8:\"requires\";s:5:\"3.6.0\";s:6:\"tested\";s:5:\"4.9.0\";s:4:\"tags\";a:72:{i:0;s:5:\"5.6.6\";i:1;s:5:\"5.6.5\";i:2;s:5:\"5.6.4\";i:3;s:5:\"5.6.3\";i:4;s:5:\"5.6.2\";i:5;s:5:\"5.6.1\";i:6;s:11:\"5.6.0-beta2\";i:7;s:11:\"5.6.0-beta1\";i:8;s:9:\"5.6.0-RC2\";i:9;s:9:\"5.6.0-RC1\";i:10;s:5:\"5.6.0\";i:11;s:5:\"5.5.9\";i:12;s:5:\"5.5.7\";i:13;s:5:\"5.5.5\";i:14;s:5:\"5.5.3\";i:15;s:5:\"5.5.2\";i:16;s:6:\"5.5.14\";i:17;s:6:\"5.5.13\";i:18;s:6:\"5.5.12\";i:19;s:6:\"5.5.11\";i:20;s:6:\"5.5.10\";i:21;s:5:\"5.5.1\";i:22;s:5:\"5.5.0\";i:23;s:5:\"5.4.8\";i:24;s:5:\"5.4.7\";i:25;s:5:\"5.4.6\";i:26;s:5:\"5.4.5\";i:27;s:5:\"5.4.4\";i:28;s:5:\"5.4.3\";i:29;s:5:\"5.4.2\";i:30;s:5:\"5.4.1\";i:31;s:5:\"5.4.0\";i:32;s:5:\"5.3.8\";i:33;s:5:\"5.3.7\";i:34;s:5:\"5.3.6\";i:35;s:5:\"5.3.5\";i:36;s:5:\"5.3.4\";i:37;s:5:\"5.3.3\";i:38;s:5:\"5.3.2\";i:39;s:6:\"5.3.10\";i:40;s:5:\"5.3.1\";i:41;s:5:\"5.3.0\";i:42;s:5:\"5.2.9\";i:43;s:5:\"5.2.8\";i:44;s:5:\"5.2.7\";i:45;s:5:\"5.2.6\";i:46;s:5:\"5.2.5\";i:47;s:5:\"5.2.4\";i:48;s:5:\"5.2.3\";i:49;s:5:\"5.2.2\";i:50;s:5:\"5.2.1\";i:51;s:5:\"5.2.0\";i:52;s:5:\"5.1.9\";i:53;s:5:\"5.1.8\";i:54;s:5:\"5.1.7\";i:55;s:5:\"5.1.6\";i:56;s:5:\"5.1.5\";i:57;s:5:\"5.1.4\";i:58;s:5:\"5.1.3\";i:59;s:5:\"5.1.2\";i:60;s:5:\"5.1.1\";i:61;s:5:\"5.1.0\";i:62;s:5:\"5.0.9\";i:63;s:5:\"5.0.8\";i:64;s:5:\"5.0.7\";i:65;s:5:\"5.0.6\";i:66;s:5:\"5.0.5\";i:67;s:5:\"5.0.4\";i:68;s:5:\"5.0.3\";i:69;s:5:\"5.0.2\";i:70;s:5:\"5.0.1\";i:71;s:5:\"5.0.0\";}s:6:\"tagged\";s:61:\"acf, advanced, custom, field, fields, form, repeater, content\";s:11:\"description\";s:1478:\"<p>Use the Advanced Custom Fields plugin to take full control of your WordPress edit screens & custom field data.</p>\n<b>Add fields on demand.</b> Our field builder allows you to quickly and easily add fields to WP edit screens with only the click of a few buttons!\n<b>Add them anywhere.</b> Fields can be added all over WP including posts, users, taxonomy terms, media, comments and even custom options pages!\n<b>Show them everywhere.</b> Load and display your custom field values in any theme template file with our hassle free developer friendly functions!\n<h4> Features </h4>\n<ul><li>Simple & Intuitive</li><li>Powerful Functions</li><li>Over 30 Field Types</li><li>Extensive Documentation</li><li>Millions of Users</li></ul>\n<h4> Links </h4>\n<ul><li>[Website](<a href=\"https://www.advancedcustomfields.com)\">www.advancedcustomfields.com)</a></li><li>[Documentation](<a href=\"https://www.advancedcustomfields.com/resources/)\">www.advancedcustomfields.com/resources/)</a></li><li>[Support](<a href=\"https://support.advancedcustomfields.com)\">support.advancedcustomfields.com)</a></li><li>[ACF PRO](<a href=\"https://www.advancedcustomfields.com/pro/)\">www.advancedcustomfields.com/pro/)</a></li></ul>\n<h4> PRO </h4>\n<p>The Advanced Custom Fields plugin is also available in a professional version which includes more fields, more functionality, and more flexibility! [Learn more](<a href=\"https://www.advancedcustomfields.com/pro/)\">www.advancedcustomfields.com/pro/)</a></p>\n\";s:12:\"installation\";s:515:\"<p>From your WordPress dashboard<ol><li><b>Visit</b> Plugins > Add New</li><li><b>Search</b> for \"Advanced Custom Fields\"</li><li><b>Activate</b> Advanced Custom Fields from your Plugins page</li><li><b>Click</b> on the new menu item \"Custom Fields\" and create your first Custom Field Group!</li><li><b>Read</b> the documentation to [get started](<a href=\"https://www.advancedcustomfields.com/resources/getting-started-with-acf/)\">www.advancedcustomfields.com/resources/getting-started-with-acf/)</a></li></ol></p>\n\";s:9:\"changelog\";s:5408:\"<h4> 5.6.7 </h4>\n<ul><li>Fixed an assortment of bugs found in 5.6.6</li></ul>\n<h4> 5.6.6 </h4>\n<ul><li>Accordion field: Added new field type</li><li>Tab field: Added logic to remember active tabs</li><li>WYSIWYG field: Fixed JS error in quicktags initialization</li><li>Core: Fixed issue preventing conditional logic for menu item fields</li><li>Core: Fixed issue preventing JS initialization for newly added menu items.</li><li>Core: Allow whitespace in input value (previously trimmed)</li><li>Core: Minor fixes and improvements</li><li>Language: Updated Italian translation - thanks to Davide Pantè</li><li>Language: Updated Brazilian Portuguese translation - thanks to Rafael Ribeiro</li><li>Language: Updated Dutch translation - thanks to Derk Oosterveld</li><li>Language: Updated Portuguese translation - thanks to Pedro Mendonça</li><li>Language: Updated Persian translation - thanks to Kamel Kimiaei</li><li>Language: Updated Swiss German translation - thanks to Raphael Hüni</li></ul>\n<h4> 5.6.5 </h4>\n<ul><li>API: Added new <code>kses</code> setting to the `acf_form()` function</li><li>Core: Added new <code>Admin Tools</code> framework (includes design refresh)</li><li>Core: Minor fixes and improvements</li><li>Language: Update Ukrainian translation - thanks to Jurko Chervony</li><li>Language: Update Russian translation - thanks to Andriy Toniyevych</li><li>Language: Update Hebrew translation - thanks to Itamar Megged</li></ul>\n<h4> 5.6.4 </h4>\n<ul><li>Google Map field: Fixed bug causing invalid url to JavaScript library</li><li>WYSIWYG field: Fixed minor z-index and drag/drop bugs</li><li>Group field: Fixed bug causing incorrect export settings</li><li>Core: Fixed bug in <code>Post Taxonomy</code> location rule ignoring selected terms during AJAX callback</li><li>Core: Fixed bug preventing a draft to validate with required fields</li><li>Language: Updated Italian translation - thanks to Davide Pantè</li><li>Language: Update Turkish translation - thanks to Emre Erkan</li><li>Language: Updated Chinese translation - thanks to Wang Hao</li><li>Language: Update Hebrew translation - thanks to Itamar Megged</li></ul>\n<h4> 5.6.3 </h4>\n<ul><li>Button Group field: Added new field type</li><li>Range field: Added missing <code>step</code> attribute to number input</li><li>Range field: Added width to number input based on max setting</li><li>Basic fields: Added missing <code>required</code> attribute to inputs</li><li>Basic fields: Removed empty attributes from inputs</li><li>API: Fixed `get_fields()` bug ignoring fields starting with an underscore</li><li>Core: Minor fixes and improvements</li><li>Language: Updated Portuguese translation - thanks to Pedro Mendonça</li><li>Language: Updated French translation - thanks to Maxime Bernard-Jacquet</li><li>Language: Updated Finnish translation - thanks to Sauli Rajala</li><li>Language: Updated German translation - thanks to Ralf Koller</li></ul>\n<h4> 5.6.2 </h4>\n<ul><li>Range field: Added new field type</li><li>Clone field: Fixed bug causing value update issues for <code>seamless</code> + widgets / nave menu items</li><li>Location: Added parent theme<code>s post templates to </code>post template\' location rule</li><li>Location: Fixed bug causing <code>nav menu</code> location rule to fail during AJAX (add new item)</li><li>Core: Fixed PHP errors in customizer when editing non ACF panels</li><li>Core: Fixed bug casing backslash character to break fields / field groups</li><li>Core: Many minor bug fixes</li><li>Language: Updated Romanian translation - thanks to Ionut Staicu</li><li>Language: Updated Italian translation - thanks to Davide Pantè</li><li>Language: Update Turkish translation - thanks to Emre Erkan</li><li>Language: Updated Russian translation - Thanks to Алекс Яровиков</li><li>Language: Updated French translation - Thanks to Julie Arrigoni</li></ul>\n<h4> 5.6.1 </h4>\n<ul><li>Fixed an assortment of bugs found in 5.6.0</li></ul>\n<h4> 5.6.0 </h4>\n<ul><li>Link field: Added new field type</li><li>Group field: Added new field type</li><li>API: Improved `have_rows()` function to work with clone and group field values</li><li>Core: Added new location for Menus</li><li>Core: Added new location for Menu Items</li><li>Core: Added types to Attachment location rule - thanks to Jan Thomas</li><li>Core: Added \"Confirm Remove\" tooltips</li><li>Core: Updated Select2 JS library to v4</li><li>Core: Minor fixes and improvements</li></ul>\n<h4> 5.5.14 </h4>\n<ul><li>Core: Minor bug fixes</li></ul>\n<h4> 5.5.13 </h4>\n<ul><li>Clone field: Improved <code>Fields</code> setting to show all fields within a matching field group search</li><li>Flexible Content field: Fixed bug causing <code>layout_title</code> filter to fail when field is cloned</li><li>Flexible Content field: Added missing <code>translate_field</code> function</li><li>WYSIWYG field: Fixed JS error when using CKEditor plugin</li><li>Date Picker field: Improved <code>Display Format</code> and <code>Return Format</code> settings UI</li><li>Time Picker field: Same as above</li><li>Datetime Picker field: Same as above</li><li>Core: Added new <code>remove_wp_meta_box</code> setting</li><li>Core: Added constants ACF, ACF_PRO, ACF_VERSION and ACF_PATH</li><li>Core: Improved compatibility with Select2 v4 including sortable functionality</li><li>Language: Updated Portuguese translation - thanks to Pedro Mendonça</li></ul>\n\";s:14:\"upgrade_notice\";s:551:\"<h4> 5.2.7 </h4>\n<ul><li>Field class names have changed slightly in v5.2.7 from `field_type-{$type}` to `acf-field-{$type}`. This change was introduced to better optimise JS performance. The previous class names can be added back in with the following filter: <a href=\"https://www.advancedcustomfields.com/resources/acfcompatibility/\">www.advancedcustomfields.com/resources/acfcompatibility/</a></li></ul>\n<h4> 3.0.0 </h4>\n<ul><li>Editor is broken in WordPress 3.3</li></ul>\n<h4> 2.1.4 </h4>\n<ul><li>Adds post_id column back into acf_values</li></ul>\n\";s:5:\"icons\";a:1:{s:7:\"default\";s:63:\"https://ps.w.org/advanced-custom-fields/assets/icon-256x256.png\";}s:7:\"banners\";a:1:{s:7:\"default\";s:66:\"https://ps.w.org/advanced-custom-fields/assets/banner-1544x500.jpg\";}}', 'no'),
